import React, { Component } from "react";
import { Image } from "react-native";

export default class Body extends Component {
  render() {
    return (
      <div>
        <Image
          source={require("../images/mother.png")}
          style={{ width: 400, height: 400 }}
        />
        <img src="../images/mother.png" />
        <img src="../images/bluehour.png" />
        <img src="../images/curse.png" />
        <img src="../images/pitbulls.png" />
        <img src="../images/killerKids.png" />
        <img src="../images/nightwatch.png" />
        <img src="../images/allSummer.png" />
        <img src="../images/winter.png" />
      </div>
    );
  }
}
